                            </div>
                            <div class="col-lg-6 bg-gradient-primary">
                                <div class="p-5">
                                    <div class="parent-container">
                                        <div class="d-flex logo mb-3" style="background-image: url({% static 'img/phloem.png' %});"></div>
                                    </div>
                                    <hr>
                                    <div class="text-center">
                                        <h1 class="h4 text-white mb-4">Welcome Back!</h1>
                                    </div>
                                    <form class="user" method = POST>
                                        {% csrf_token %}
                                        <div>
                                           <p class="small text-danger">{{error}}</p>
                                        </div>
                                        <div class="form-group mb-3">

                                            <select class="form-select form-control " id="userType" name="user_type" required>
                                                <option value="Student">Select User Type</option>
                                                <option value="Student">Student</option>
                                                <option value="Teacher">Teacher</option>
                                                <option value="Manager">Manager</option>
                                            </select>
                                        </div>
                                        <div class="form-group">
                                            <input type="email" name="email" class="form-control form-control-user"
                                                id="exampleInputEmail" aria-describedby="emailHelp"
                                                placeholder="Enter Email Address...">
                                        </div>
                                        <div class="form-group">
                                            <input type="password" name="password" class="form-control form-control-user"
                                                id="exampleInputPassword" placeholder="Password">
                                        </div>
                                        <input type="submit" class="btn btn-primary btn-user btn-block" value="LOGIN">
                                    </form>
                                    <hr>

                                </div>
                            </div>
                        </div>
                    </div>
                </div>

            </div>

        </div>

    </div>

    <!-- Bootstrap core JavaScript-->
    <script src="{% static 'vendor/jquery/jquery.min.js' %}"></script>
    <script src="{% static 'vendor/bootstrap/js/bootstrap.bundle.min.js' %}"></script>

    <!-- Core plugin JavaScript-->
    <script src="{% static 'vendor/jquery-easing/jquery.easing.min.js' %}"></script>

    <!-- Custom scripts for all pages-->
    <script src="{% static 'js/sb-admin-2.min.js' %}"></script>
